import React from "react";
import AppNavbar from "../components/AppNavbar"; // ⬅️ import the Navbar
import { Container } from "react-bootstrap";

export default function AppLayout({ children }) {
  return (
    <>
      <AppNavbar />
      <Container fluid className="mt-4">
        {children}
      </Container>
    </>
  );
}
